] para encontrar uno de su gusto, te recomiendo el modo de persecución para esta tarea.

- Aparte del modo de Puesta en Escena, el HUD también tiene un modo de acoplamiento, pulse el botón de acoplamiento bajo las etapas en la parte inferior izquierda de la pantalla. Lo que esto hace es cambiar el esquema de control de la rotación a translación, por lo que sus teclas W, A, S, D controlarán la traslación e IzquierdaSHIFT y LeftControl están arriba y hacia abajo, un poco como el control EAV de un Kerbal.

- Uso del modo de acoplamiento no es estrictamente necesario. Usar el modo que mejor se adapte a usted, pero recuerde que puede utilizar las I, K, J, L, H y N para trasladar el modo normal de Puesta en Escena, se puede comprobar las asociaciones de teclas en cualquier momento en el menú de pausa.

