Otra opción es transferir la tripulación a su nave, desacople (clic derecho en el puerto de acoplamiento) y aproveche un viaje de regreso a Kerbin, para hacer eso, haga clic en la escotilla de tripulación del buque varado y seleccionar el Kerbal a transferir.
La tercera opción es simplemente establecer un curso de retorno como estás ahora, atracado y todo. Déjame saber lo que decidas, te veo en tierra.

]: Lanzar / Activar Siguiente Etapa

Observe el indicador de la etapa en la esquina inferior izquierda. Muestra la fase activa. Puesto que no hemos puesto en marcha, sin embargo, se muestra la primera etapa para ser activada. He bloqueado los controles de etapa por ahora, por lo que el LED al lado del indicador se enciende de color púrpura. 

Una cosa más sobre la estadificación, si la disposición del escenario generado automáticamente, o incluso uno hecho por usted, está causando conflictos, o simplemente cambian de opinión acerca de algo, puede editar la secuencia de fase sobre la marcha ... nunca mejor dicho ... no tendrá que volver a la planta de montaje.

